import fetch from 'isomorphic-unfetch';

const DeleteListing = ({listings, id})=>{
    return (
        <div>
            <a href="#" className="delete" onClick={()=>{
                console.log(listings);
            }}>Delete home</a>
            <style jsx>
                {`
                    .delete{
                        color: white;
                    }

                    .delete:link, .delete:active{
                        display: inline-block;
                        text-decoration: none;
                        font-size: 1.25rem;
                        padding: .5rem 1rem;
                        background-color: red;
                    }
                `}
            </style>
        </div>
    )
}

DeleteListing.getInitialProps = async()=> {
    try {
        const res = await fetch('https://localhost/3004/listings');
        const data = await res.json();
    } catch (e) {
        console.log(e);
    }

    return {
        listings : data
    }
}

export default DeleteListing;
